void TestPoistats::TestGenerateRotationMatrix3u2v() {
  
  std::cerr << "TestGenerateRotationMatrix3u2v" << std::endl;

// input: vector, vector
// output: 3x3 rotation matrix
  typedef itk::Image<float, 3> FloatImage3DType;
  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::PoistatsFilter< TensorImageType, FloatImage3DType > 
    PoistatsFilterType;
  
  const int arraySize = 3;
  PoistatsFilterType::ArrayType u( arraySize );
  u[ 0 ] = 1.0;
  u[ 1 ] = 0.0;
  u[ 2 ] = 0.0;
    
  PoistatsFilterType::ArrayType v( arraySize );
  v[ 0 ] = -0.2;
  v[ 1 ] = 1.2;
  v[ 2 ] = 0.4;

  const double expectedRotation[][ arraySize ] = {
   -0.2000,   -0.9295,   -0.3098,
    0.9295,   -0.0800,   -0.3600,
    0.3098,   -0.3600,    0.8800
  };
  
  PoistatsFilterType::MatrixType actualRotation( 3, 3 );
  
  PoistatsFilterType::GenerateRotationMatrix3u2v( &u, &v, &actualRotation );
          
  const double tolerance = 0.00005;
  for( int cRow=0; cRow<actualRotation.rows(); cRow++ ) {
    for( int cCol=0; cCol<actualRotation.cols(); cCol++ ) {
       double expected = expectedRotation[ cRow ][ cCol ];
       double result = actualRotation[ cRow ][ cCol ];
       CPPUNIT_ASSERT_DOUBLES_EQUAL( expected, result, tolerance );    
    }
  }
  
}

void TestPoistats::TestGetMagnetToSliceFrameRotation() {

  std::cerr << "TestGetMagnetToSliceFrameRotation" << std::endl;
  
  const double expectedRotation[][ 3 ] = {
    0.990816, -0.135217,  0,
    0.135217, 0.990816,   0,
    0,        0,          1
  };

  typedef TensorReaderStrategy::TensorPixelType TensorPixelType;
  typedef TensorReaderStrategy::TensorImageType TensorImageType;
  typedef itk::Image< float, 3 > OutputImageType;
  typedef itk::PoistatsFilter< TensorImageType, OutputImageType > 
    PoistatsFilterType;
      
  PoistatsFilterType::Pointer poistatsFilter = PoistatsFilterType::New();

  TensorImageType::Pointer tensors = TensorImageType::New();
  TensorImageType::DirectionType direction = tensors->GetDirection();
  
  direction( 2, 2 ) = 0.990816;
  direction( 1, 2 ) = 0.124036;
  
  tensors->SetDirection( direction );
  poistatsFilter->SetInput( tensors );
  
  PoistatsFilterType::MatrixType actualRotation( 3, 3 );
  poistatsFilter->GetMagnetToSliceFrameRotation( &actualRotation );
    
  const double tolerance = 0.00005;
  for( int cRow=0; cRow<actualRotation.rows(); cRow++ ) {
    for( int cCol=0; cCol<actualRotation.cols(); cCol++ ) {
       double expected = expectedRotation[ cRow ][ cCol ];
       double result = actualRotation[ cRow ][ cCol ];
       CPPUNIT_ASSERT_DOUBLES_EQUAL( expected, result, tolerance );    
    }
  }

}

